import React from "react";

const NutritionCard = ({ image, title }) => {
    return (
      <>
        <div className="lg:hidden bg-white shadow rounded-md w-24 md:w-56">
          <div className="w-full h-24">
            <img
              src={image}
              alt="food"
              className="w-full h-full object-cover rounded-t-md"
            />
          </div>
          <div>
            <h3 className="text-sm my-1 text-center font-light">{title}</h3>
          </div>
        </div>
      </>
    ); 
  };
  
  const NutritionCarousalCard = (props) => {
    return (
      <>
        <NutritionCard {...props} />
      </>
    );
  };
  
 
export default NutritionCarousalCard;
